com.webreach.mirth.model.Step.script:
//var HL7DateFmt = "yyyyMMddHHmmss.SSSSZ";
var HL7DateFmt = "yyyyMMddHHmmss";
var XMLDateFmt = "yyyy'-'MM'-'dd'T'hh:mm:ss";

var dob = channelMap.get('dob');
if (dob != 0)
{
	dob = DateUtil.convertDate(HL7DateFmt,XMLDateFmt,dob);
 	channelMap.put('dob',dob);
}

var admitdatetime = channelMap.get('admitdatetime');
if (admitdatetime != 0)
{
	admitdatetime = DateUtil.convertDate(HL7DateFmt,XMLDateFmt,admitdatetime);
 	channelMap.put('admitdatetime',admitdatetime);
}

var dischargedatetime = channelMap.get('dischargedatetime');
if (dischargedatetime != 0)
{
	dischargedatetime = DateUtil.convertDate(HL7DateFmt,XMLDateFmt,dischargedatetime);
 	channelMap.put('dischargedatetime',dischargedatetime);
}

